	this.timeline.addTween(cjs.Tween.get({}).to({state:[]}).to({state:[{t:this.Next_Btn,p:{y:94}},{t:this.Clear_Btn}]},1).to({state:[{t:this.Back_Btn},{t:this.Next_Btn,p:{y:94.35}},{t:this.Clear_Btn}]},1).to({state:[{t:this.Back_Btn},{t:this.Clear_Btn}]},6).wait(1));

	// Points
	this.P4 = new lib.Symbol52();
	this.P4.name = "P4";
	this.P4.setTransform(874.5,414.9);
	this.P4.alpha = 0.0117;

